INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (1, 'extension-manager-upgrades', 'Extension Manager Upgrades', 'Simplify the way extensions are installed and registered so that: 1. third party applications can easily register and deregister extensions that live with their code. 2. developers can easily register extensions that they are developing out of a location apart from their build (e.g. their home directory), and  3. developers can easily install extensions for testing.', 16, 13, NULL, 1, '2005-08-24 16:03:46.479655', 4, NULL, NULL, NULL, NULL, 40, 50, 'http://wiki.mozilla.org/Firefox:1.1_Product_Team', NULL, NULL, false, NULL, 95, 30, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, false, '2012-01-25 05:54:58.866469', NULL, 1, NULL, NULL);
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (2, 'canvas', 'Support <canvas> Objects', 'With the Firefox 1.1 Developer Preview Release, Firefox includes a new HTML element for programmable graphics. <canvas> is based on the WhatWG canvas specification (http://www.whatwg.org/specs/web-apps/current-work/#graphics), which itself is based on Apple''s <canvas> implemented in Safari. It can be used for rendering graphs, UI elements, and other custom graphics on the client.', 16, NULL, NULL, NULL, '2005-08-24 16:05:03.406307', 4, NULL, NULL, NULL, NULL, 40, 50, 'http://developer.mozilla.org/en/docs/Drawing_Graphics_with_Canvas', NULL, NULL, false, NULL, 0, 30, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, false, '2012-01-25 05:54:58.868001', NULL, 1, NULL, NULL);
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (3, 'svg-support', 'Support Native SVG Objects', 'Scalable Vector Graphics (SVG) is an XML markup language for describing two-dimensional vector graphics. Mozilla should natively support embedded SVG images in HTML documents, or SVG served directly, much as PNG or JPEG images can be served.', 16, 13, 2, 28, '2005-08-24 16:10:05.078543', 4, NULL, NULL, NULL, NULL, 10, 70, 'http://developer.mozilla.org/en/docs/SVG', NULL, NULL, true, NULL, 75, 30, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13, '2006-08-10 22:04:23.681392', false, '2012-01-25 05:54:58.869242', NULL, 1, NULL, NULL);
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (4, 'e4x', 'Support E4X in EcmaScript', 'E4X adds native XML datatypes to the ECMAScript language, extends the semantics of familiar ECMAScript operators for manipulating XML objects and adds a small set of new operators for common XML operations, such as searching and filtering. It also adds support for XML literals, namespaces, qualified names and other mechanisms to facilitate XML processing.', 16, 14, 28, NULL, '2005-08-24 16:11:37.431981', 4, NULL, NULL, NULL, 1, 20, 0, 'http://www.ecma-international.org/publications/standards/Ecma-357.htm', 'This is the status whiteboard. Dig it?', NULL, false, NULL, 0, 30, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, false, '2012-01-25 05:54:58.869702', NULL, 1, NULL, NULL);
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (5, 'mergewin', 'Merge Open Browser Windows with "Consolidate Windows"', 'It should be possible to merge multiple open browser windows with a "Consolidate Windows" menu option.', 16, NULL, NULL, NULL, '2005-10-19 18:03:59.900723', 4, NULL, NULL, NULL, NULL, 40, 50, NULL, NULL, NULL, false, NULL, 0, 30, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, false, '2012-01-25 05:54:58.870136', NULL, 1, NULL, NULL);
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (6, 'media-integrity-check', 'CD Media Integrity Check', 'Sometimes, problems installing Ubuntu from CD are caused by bad sectors on the CD media itself. It should be easy to check the quality of the CD directly from within the installer.', 12, NULL, NULL, NULL, '2005-11-02 15:14:22.177596', NULL, NULL, 1, NULL, NULL, 35, 5, 'https://wiki.ubuntu.com/MediaIntegrityCheck', NULL, NULL, false, NULL, 0, 30, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, false, '2012-01-25 05:54:58.870537', NULL, 1, NULL, NULL);
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (7, 'cluster-installation', 'Facilitate mass installs  of Ubuntu using Netboot configuration', 'We want to enable users to easily perform mass installations of Ubuntu on a pool of machines. We develop a console tool to intelligently manage dhcpd and syslinux configuration, and provide a GUI frontend for easy point and click configuration.
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (8, 'revu', 'The REVU Review Tracking System', 'Revu2 is a tool for assisting MOTUs to review packages. Packages are created mainly be contributors, but also by other tools.
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (9, 'usplash-on-hibernation', 'Activating Usplash during Hibernation', 'In order to conceal scary kernel messages, and provide some instruction and indication of progress to the user, usplash could be activated during the hibernation process.
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (10, 'thinclient-local-devices', 'Support for local devices on Ubuntu thin clients', 'Provide support for locally-attached devices on thin clients, such as USB devices and floppy drives.', 1, 8, NULL, 6, '2006-04-12 07:44:42.314166', NULL, NULL, 5, 12, NULL, 10, 50, 'http://wiki.ubuntu.com/ThinClientLocalDevices', NULL, NULL, false, NULL, 90, 10, NULL, 1, '2006-08-06 16:11:59.8599', 1, '2006-04-12 07:44:42.314166', 1, '2006-08-07 22:52:08.419316', 1, '2006-08-10 22:04:23.681392', false, '2012-01-25 05:54:58.872477', NULL, 1, NULL, NULL);
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (11, 'kde-desktopfile-langpacks', 'KDE Desktop File Language Packs', 'As of Kubuntu 5.10, language packs cannot provide updated translations for .desktop and .directory files (used for menu entries). We should make this possible.
INSERT INTO public.specification (id, name, title, summary, owner, assignee, drafter, approver, datecreated, product, productseries, distribution, distroseries, milestone, definition_status, priority, specurl, whiteboard, superseded_by, direction_approved, man_days, implementation_status, goalstatus, fti, goal_proposer, date_goal_proposed, goal_decider, date_goal_decided, completer, date_completed, starter, date_started, private, date_last_changed, last_changed_by, information_type, access_policy, access_grants) VALUES (12, 'krunch-desktop-plan', 'The Krunch Desktop Plan', 'This specification describes the plan for the Krunch Desktop. It will identify specific areas where additional polish will be added to ensure that Kapper is, in fact, krunchy.', 1, 33, NULL, NULL, '2006-04-12 07:57:24.675444', NULL, NULL, 5, 12, NULL, 35, 0, 'https://wiki.ubuntu.com/KrunchDesktopPlan', NULL, NULL, false, NULL, 0, 20, NULL, 1, '2006-08-06 16:11:59.8599', 1, '2006-04-12 07:57:24.675444', NULL, NULL, NULL, NULL, false, '2012-01-25 05:54:58.873415', NULL, 1, NULL, NULL);
