INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (1, '2007-11-25 00:44:32.186178', '2007-11-20 03:00:00', 1, NULL, 1, NULL, 'Every Macedonian Student to Use Ubuntu-Powered Computer Workstations', 'The Macedonia Ministry of Education and Science will deploy more than 180,000 workstations running Canonical’s Edubuntu 7.04 as part of its "Computer for Every Child" project.', 'http://www.ubuntu.com/news/macedonia-school-computers', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (2, '2007-11-25 00:48:53.347225', '2007-10-15 07:00:00', 1, NULL, 1, NULL, 'Ubuntu 7.10 Released, Delivering the Best of Open Source Software', 'Canonical Ltd. announced today the upcoming availability of version 7.10 of the Ubuntu Server, Desktop, Kubuntu and Edubuntu Editions. All will be available for free download on Thursday 18 October. Canonical is the commercial sponsor of Ubuntu.
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (3, '2007-11-25 00:50:56.337934', '2007-09-11 04:00:00', 1, NULL, 1, NULL, 'Canonical to Provide Optimized Ubuntu OS Layer for VMware Virtual Appliances', 'Canonical Ltd., the commercial sponsor of Ubuntu, today announced the availability of its Ubuntu JeOS (Just Enough Operating System) edition. Ubuntu JeOS (pronounced "Juice") is an efficient variant of the popular desktop and server operating system, configured specifically for virtual appliances.', 'http://www.ubuntu.com/news/ubuntu-jeos', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (4, '2007-11-25 00:52:09.015964', '2007-08-07 04:29:00', 1, NULL, 1, NULL, 'Dell Answers Customer Calls for Linux in Europe', 'Dell today unveiled two consumer PCs in Europe – the Inspiron 6400n and the Inspiron 530n – with the Ubuntu 7.04 Linux operating system factory installed. Available now in the United Kingdom, Germany and France, the systems are Dell’s first steps to meet the needs of the Linux enthusiast community outside of the United States.
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (5, '2007-11-25 00:53:11.94385', '2007-08-03 10:56:00', 1, NULL, 1, NULL, 'Canonical and Altkom Akademia partner to deliver Ubuntu Certified Professional training in Poland', 'Canonical Ltd, the commercial sponsor of Ubuntu, today announced it has signed an agreement with Altkom Akademia to deliver ''Ubuntu Certified Professional'' (UCP) training in Poland. Altkom will deliver official courses in Warsaw starting in September 2007.
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (6, '2007-11-25 00:54:20.800516', '2007-07-22 14:43:00', 1, NULL, 1, NULL, 'Canonical Launches Web-Based Systems Management Tool For Ubuntu Deployments', 'Canonical announced today the availability of Landscape, its web-based systems management tool for Ubuntu servers and desktops.
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (7, '2007-11-25 00:55:21.295487', '2007-06-29 17:28:00', 1, NULL, 1, NULL, 'Ubuntu Receives Readers'' Choice Award for ''Best Linux Distribution''', 'Canonical, Ltd., the commercial sponsor of Ubuntu, today announced that it won Enterprise Open Source Magazine’s Readers’ Choice Award for the “Best Linux Distribution,” voted on by members of the open source community.
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (8, '2007-11-25 00:59:12.513928', '2007-11-25 00:59:12.513928', 1, NULL, 1, NULL, 'Ubuntu takes majority market share in Bapetikosweti', 'In a stunning turnaround, the independent republic of Bapetikosweti has declared that all computers sold within its borders should have Ubuntu preinstalled, fully translated into the local dialect, Uysh. A government spokesman said "we wanted to show that this could be nation of change".', NULL, false, '2007-11-25 00:59:23.363818');
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (9, '2007-11-25 01:00:57.90496', NULL, 1, NULL, 1, NULL, 'Ubuntu 8.04 Wins a "100 Best Products of 2008 Award" from PC World', 'Ubuntu 7.08, commercially sponsored by Canonical Ltd., was honored by PC World with a 100 Best Products of 2008 Award. The article is available now on PCWorld.com, and will also be featured in the July 2008 issue of PC World, which hits newsstands June 12.
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (10, '2007-11-25 01:13:31.234806', '2007-11-19 20:00:00', 1, 4, NULL, NULL, 'Firefox 3 Beta 1 Ready for Testing', 'Mozilla announced Firefox 3 Beta 1 today. Mike Betlzner has a comprehensive post on DevNews, crossposted below. Reminder that the Firefox 3 Beta 1 milestone release is intended for testing purposes only and is not for casual users.', 'http://blog.mozilla.com/blog/2007/11/20/firefox-3-beta-1-ready-for-testing/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (11, '2007-11-25 01:14:42.885968', '2007-10-25 08:02:00', 1, 4, NULL, NULL, 'Extend Firefox 2 is Here!', 'Will you be the brain behind the next great web innovation? Get ready to show the world what you’re made of… Extend Firefox 2 is here! Extend Firefox 2 is a developer contest with prizes awarded for creating new Firefox Add-ons. All entries will be judged by a panel of experts.', 'http://blog.mozilla.com/blog/2007/10/25/extend-firefox-2-is-here/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (12, '2007-11-25 01:16:01.858804', '2007-07-09 12:00:00', 1, 4, NULL, NULL, 'Four Hundred Million Firefox Downloads', 'On November 9th, 2004, you all started a movement. Spread Firefox, supported by tens of thousands of contributors, took just 99 days to deliver 25 million downloads of Firefox to a world of people desperate for a better Web — a Web that didn’t overwhelm them with pop-ups, a Web that didn’t infect their systems with viruses and spyware, a Web that was fun again, simply put, a Web that worked.', 'http://blog.mozilla.com/blog/2007/09/07/four-hundred-million-firefox-downloads/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (13, '2007-11-25 01:17:47.035452', '2007-08-06 09:45:00', 1, 4, NULL, NULL, 'Rock Your Firefox!', ' We’re excited to announce the launch of another tool that will allow you to surf your web, your way: Rock Your Firefox! Rock Your Firefox is an application built on the Facebook® Platform allowing you to personalize, customize, and essentially rock out your browser, and share it with your friends. Browse through more than 2000 add-ons and recommend those you like to your friends - and see what they recommend for you.', 'http://blog.mozilla.com/blog/2007/08/06/rock-your-firefox/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (14, '2007-11-25 01:19:22.075917', '2007-06-19 22:23:00', 1, 4, NULL, NULL, 'Firefox support options', 'We often get letters, voicemails and emails asking, “How do I get help for Firefox?” That’s a good question, so I thought I would share the available and very helpful resources.', 'http://blog.mozilla.com/blog/2007/06/20/firefox-support-options/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (15, '2007-11-25 01:20:14.590274', '2007-06-15 02:13:00', 1, 4, NULL, NULL, 'A few foxy tips', 'A great deal of Firefox’s popularity is due to the ability to personalize it and add all sorts of functionality via add-ons. But there are some nifty shortcuts and features right in Firefox. I asked around here at Mozilla for favorite Firefox features and time savers.', 'http://blog.mozilla.com/blog/2007/06/15/a-few-foxy-tips/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (16, '2007-11-25 01:21:54.413156', '2007-09-18 02:24:00', 1, 8, NULL, NULL, 'Mozilla’s New Focus on Thunderbird and Internet Communications', 'Mozilla has been investing in email since the Foundation was created. We have a good, solid client in Thunderbird, and we have aspirations to do more. We’ve spent the last few months working on how to meet those aspirations. Many thanks to everyone who participated in the discussions.
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (17, '2007-11-25 01:25:18.801758', '2007-09-10 10:28:00', 1, NULL, NULL, 4, 'Air Mozilla Live this Wednesday - Window Snyder, Mozilla Security', 'Air Mozilla is the live “call in” show featuring influential Mozilla contributors from all over the world. This week’s show will feature Window Snyder, Chief Security Something or Other, talking about Mozilla and Web security. So join us this Wednesday at air.mozilla.com and on IRC or IM to be a part of the fun.', 'http://blog.mozilla.com/blog/2007/10/09/air-mozilla-live-this-wednesday-window-snyder-mozilla-security/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (18, '2007-11-25 01:26:23.455036', '2007-09-18 12:28:00', 1, NULL, NULL, 4, 'Special Edition of Air Mozilla: Mitchell Baker and David Ascher', 'Tomorrow’s Air Mozilla Live will be focused on the recent announcements around Mozilla’s increasing investment in email and messaging. We’ll have both Mitchell Baker, Chairman of the Board, and David Ascher, the leader of Mozilla’s new messaging company taking your questions, live just after 2PM Pacific. So join us this Wednesday at air.mozilla.com and on IRC or IM to be a part of the fun.', 'http://blog.mozilla.com/blog/2007/09/18/special-edition-of-air-mozilla-mitchell-baker-and-david-ascher/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (19, '2007-11-25 01:27:29.708004', '2007-09-15 07:03:00', 1, NULL, NULL, 4, 'Mozilla 24 is LIVE!', 'Our colleagues in Japan kicked off Mozilla 24 in Tokyo this evening. If you weren’t able to make it there like me, you don’t have to miss out on all the action. You can watch live from the Mozilla 24 site now.', 'http://blog.mozilla.com/blog/2007/09/15/mozilla-24-is-live/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (20, '2007-11-25 01:28:31.840429', '2007-09-10 07:26:00', 1, NULL, NULL, 4, 'Count down to Mozilla 24!', 'We’re just a few days away from Mozilla 24, our global community event that will be taking place in Paris, Tokyo, the S.F. Bay Area (Stanford University) and now Thailand! Here is a recap of the Mozilla 24 events near you.', 'http://blog.mozilla.com/blog/2007/09/10/count-down-to-mozilla-24/', true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (21, '2007-11-25 01:30:55.41149', '2007-08-07 12:22:00', 1, NULL, NULL, 4, 'Announcing the Grand Re-Opening of the Mozilla Store', 'Hi all. I’m excited to announce that the revamped Mozilla Store is now live!
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (22, '2007-11-25 01:32:06.722004', NULL, 1, NULL, NULL, 4, 'Google become Platinum Sponsor of Mozilla', 'In a landmark deal for an open source project, Mozilla and Google have agreed that Google will provide free food to all Mozilla contributors, regardless of their domicile.', NULL, true, NULL);
INSERT INTO public.announcement (id, date_created, date_announced, registrant, product, distribution, project, title, summary, url, active, date_updated) VALUES (23, '2007-11-23 01:32:06.722004', '2007-11-23 01:32:06.722004', 1, NULL, 1, NULL, 'Ampersand="&" LessThan="<" GreaterThan=">"', 'This is to test that special characters get escaped and displayed correctly.
