INSERT INTO public.faq (id, title, tags, content, product, distribution, owner, date_created, last_updated_by, date_last_updated, fti) VALUES (6, 'How can I play MP3/Divx/DVDs/Quicktime/Realmedia files or view Flash/Java web pages', NULL, 'Playing many common formats such as DVIX, MP3, DVD, or Flash animations require the installation of plugins.
