INSERT INTO public.faq (id, title, tags, content, product, distribution, owner, date_created, last_updated_by, date_last_updated, fti) VALUES (9, 'How do I troubleshoot problems with extensions/themes?', NULL, 'Poorly designed or incompatible Extensions can cause problems with your browser, including make it crash, slow down page display, etc. If you encounter strange problems relating to parts of the browser no longer working, the browser not starting, windows with strange or distorted appearance, degraded performance, etc, you may be suffering from Extension or Theme trouble. Restart the browser in Safe Mode. On Windows, start using the "Safe Mode" shortcut created in your Start menu or by running firefox.exe -safe-mode. On Linux, start with ./firefox -safe-mode and on Mac OS X, run:
INSERT INTO public.faq (id, title, tags, content, product, distribution, owner, date_created, last_updated_by, date_last_updated, fti) VALUES (10, 'How do I install plugins (Shockwave, QuickTime, etc.)?', NULL, 'PluginDoc (http://plugindoc.mozdev.org/faqs/) lists common plugins (such as RealPlayer, QuickTime, Flash, Java, etc.) and how to install them in Firefox.', 4, NULL, 16, '2007-07-03 22:05:36.648951', NULL, NULL, NULL);
INSERT INTO public.faq (id, title, tags, content, product, distribution, owner, date_created, last_updated_by, date_last_updated, fti) VALUES (11, 'What''s the keyboard shortcut for [random feature]?', NULL, 'See the Keyboard Shortcuts table available at http://www.mozilla.org/support/firefox/keyboard  for a list of the most common keyboard shortcuts.', 4, NULL, 12, '2007-07-07 16:03:54.231152', NULL, NULL, NULL);
