INSERT INTO public.karmacategory (id, name, title, summary) VALUES (2, 'bugs', 'Bug Management', 'This karma category covers work in the Malone bug tracking system, such as filing, closing and otherwise working with bugs.');
INSERT INTO public.karmacategory (id, name, title, summary) VALUES (3, 'translations', 'Translations in Rosetta', 'This categor covers all actions related to translation using the Rosetta web translation portal. Creating new translation projects, submitting new translations and editing existing translations will all earn karma.');
INSERT INTO public.karmacategory (id, name, title, summary) VALUES (6, 'specs', 'Specification Tracking', 'This category includes all karma associated with the Launchpad specification tracking system.');
INSERT INTO public.karmacategory (id, name, title, summary) VALUES (7, 'answers', 'Answer Tracker', 'This is the category for all karma associated with helping with users questions in the Launchpad Answer Tracker. Help solve users problems to earn this karma.');
INSERT INTO public.karmacategory (id, name, title, summary) VALUES (8, 'code', 'Bazaar Branches', 'This category for all karma associated with branches and the links between branches and other Launchpad entities.');
INSERT INTO public.karmacategory (id, name, title, summary) VALUES (9, 'soyuz', 'Soyuz', 'This category is for all karma associated with Soyuz actions.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (1, 2, 10, 'bugcreated', 'New Bug Filed', 'The user filed a new bug report. This is distinct from creating a new "task" for an existing bug, on, say, an upstream product.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (2, 2, 0, 'bugcommentadded', 'Bug Comment Added', 'The user commented on an existing bug in Malone.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (3, 2, 1, 'bugtitlechanged', 'Edited Bug Title', 'The user edited the title of the bug to provide a clearer idea of the core issue.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (4, 2, 2, 'bugsummarychanged', 'Edited Bug Summary', 'The user edited the bug summary. This will specifically help users searching for existing bugs in Malone.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (5, 2, 3, 'bugdescriptionchanged', 'Edited Bug Description', 'The user edited the bug description to describe more clearly the specific symptoms and expected outcomes for the bug. This will also improve the ability of other users to find this bug report and avoid creating duplicates.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (6, 2, 10, 'bugextrefadded', 'Bug External Reference Added', 'The user provided a URL to information which is relevant to this bug, for example, to a mailing list archive where it is discussed, or to a detailed problem report.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (7, 2, 15, 'bugcverefadded', 'Bug CVE Link Added', 'The user has linked a bug report to a specific entry in the CVE database.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (8, 2, 10, 'bugfixed', 'Bug Marked as Fixed', 'The user marked a bug as fixed.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (9, 2, 10, 'bugtaskcreated', 'Bug Task Created', 'The user has created a new task on a bug. This means that they have indicated that the same bug exists in another place (for example, upstream) and have reported that in Malone.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (10, 3, 1, 'translationtemplateimport', 'Import of Translation Template', 'The user updated a translation template, providing a newer version to be imported in Rosetta.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (11, 3, 0, 'translationimportupstream', 'Upstream Translation Imported', 'The user imported a set of upstream translations into Rosetta');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (12, 3, 2, 'translationtemplatedescriptionchanged', 'Edited Translation Template Description', 'The user updated the description of a specific translation template.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (13, 3, 1, 'translationsuggestionadded', 'Translation Suggestion', 'The user contributed a new suggested translation. That may not yet have been accepted, but is valued nonetheless.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (14, 3, 1, 'translationsuggestionapproved', 'Translation Suggestion Approved', 'The user approved a translation suggestion that was previously contributed by someone else.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (15, 3, 1, 'translationreview', 'Translation Review', 'The user has completed a review of suggested translations.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (16, 2, 3, 'bugrejected', 'Bug Rejected', 'The user has rejected a bug.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (17, 2, 5, 'bugaccepted', 'Bug Accepted', 'The user has marked a bug as accepted.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (18, 2, 1, 'bugtaskimportancechanged', 'Bug importance changed', 'Updating the importance of a bug to a specific context. (The importance of a bug can vary depending on where the buggy code is being used.)');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (19, 2, 1, 'bugtaskprioritychanged', 'Bug Priority Changed', 'The user has updated the priority of a particular bug task. Note that bug task has a distinct priority, because each of them will likely have a different developer responsible for them.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (20, 2, 5, 'bugmarkedasduplicate', 'Bug Marked as Duplicate', 'The user has marked a bug as a duplicate of another bug. This greatly reduces the amount of time developers need to spend reviewing existing bug lists.');
INSERT INTO public.karmaaction (id, category, points, name, title, summary) VALUES (21, 2, 10, 'bugwatchadded', 'Bug Watch Added', 'The user has linked an existing bug in Launchpad to an external bug tracker, to indicate that the bug is being tracked in that bug tracker too.');
