INSERT INTO public.potranslation (id, translation) VALUES (536, 'Les paramètres globaux peuvent être modifiés dans /etc/mozilla/prefs.js');
INSERT INTO public.potranslation (id, translation) VALUES (537, 'La version de Mozilla dans Debian charge le fichier /etc/mozilla/prefs.js après d''autres scripts de configuration.');
INSERT INTO public.potranslation (id, translation) VALUES (538, 'Vous pouvez modifier dans ce fichier les paramètres globaux (p. ex. les paramètres concernant les polices).');
INSERT INTO public.potranslation (id, translation) VALUES (539, 'Automatique, esddsp (pour GNOME), artsdsp (pour KDE), Aucun');
INSERT INTO public.potranslation (id, translation) VALUES (540, 'Module d''encapsulation du serveur de son :');
INSERT INTO public.potranslation (id, translation) VALUES (541, 'Il arrive que Mozilla soit bloqué parce que certains greffons (« plugins ») -- p. ex. Flash -- verrouillent le périphérique audio /dev/dsp. Il est possible d''encapsuler l''accès au périphérique /dev/dsp pour résoudre ce problème.  « Automatique » sélectionne un module d''encapsulation du dsp en fonction du serveur de son en cours d''exécution. Si aucun gestionnaire de son n''est détecté, Mozilla n''utilisera aucun module d''encapsulation. Ce choix sera sauvegardé dans /etc/mozilla/mozillarc et pourra être modifié dans votre fichier ~/.mozillarc.');
INSERT INTO public.potranslation (id, translation) VALUES (542, 'Faut-il activer la sélection automatique de la langue/région ?');
INSERT INTO public.potranslation (id, translation) VALUES (543, 'Ce réglage permet de choisir automatiquement les extensions de langue et de région en fonction des paramètres régionaux de l''utilisateur. Il facilitera la tâche d''un administrateur système qui travaille pour de nombreux utilisateurs peu expérimentés qui ne parlent pas l''anglais.');
INSERT INTO public.potranslation (id, translation) VALUES (544, 'Pour que la configuration automatique fonctionne, il faut que les variables d''environnement LC_MESSAGES ou LC_ALL soient correctement définies.');
INSERT INTO public.potranslation (id, translation) VALUES (545, 'Arquivo /etc/mozilla/prefs.ja disponível para preferências personalizadas.');
INSERT INTO public.potranslation (id, translation) VALUES (546, 'O pacote Debian do Mozilla irá carregar o arquivo /etc/mozilla/prefs.js após carregar alguns scripts de prefrências padrão.');
INSERT INTO public.potranslation (id, translation) VALUES (547, 'Você pode editar esse arquivo para definir configurações válidas para todos os usuários do sistema. (por exemplo, configurações de fontes)');
INSERT INTO public.potranslation (id, translation) VALUES (548, 'auto, esddsp, artsdsp, nenhum');
INSERT INTO public.potranslation (id, translation) VALUES (549, 'Por favor, escolha o wrapper de seu servidor de som.');
INSERT INTO public.potranslation (id, translation) VALUES (550, 'Algumas vezes o Mozilla pode travar devido a alguns plugins (por exemplo, o plugin de Flash) tentarem travar o acesso ao dispositivo de som /dev/dsp. Você pode usar um wrapper dsp para resolver esse problema. A opção ''auto'' irá decidir qual wrapper dsp deverá ser usado de acordo com o daemon de som em execução. Quando nenhum daemon de som for detectado, o Mozilla não utilizará nenhum wrapper. Esta configuração será gravada no arquivo /etc/mozilla/mozillarc e poderá ser sobreescrita caso esteja definida em seu arquivo ~/.mozillarc.');
INSERT INTO public.potranslation (id, translation) VALUES (551, 'Habilitar seleção automática de Idioma/Região ?');
INSERT INTO public.potranslation (id, translation) VALUES (552, 'Esta configuração fornece uma seleção automática de idioma/região no Mozilla utilizando as configurações de locale. A mesma pode auxiliar um administrador de sistema que precisar lidar com centenas de novatos que não falam inglês.');
INSERT INTO public.potranslation (id, translation) VALUES (553, 'Por favor, defina suas variáveis de ambiente LC_MESSAGE e LC_ALL para que esta configuração funcione corretamente.');
INSERT INTO public.potranslation (id, translation) VALUES (554, '設定のカスタマイズに /etc/mozilla/prefs.js が利用できます。');
INSERT INTO public.potranslation (id, translation) VALUES (555, 'Debian の mozilla は デフォルトの設定スクリプトのあとに /etc/mozilla/prefs.js を読み込みます。');
INSERT INTO public.potranslation (id, translation) VALUES (556, 'このファイルにより、システムワイドの設定ができます。(例えばフォントなど)');
INSERT INTO public.potranslation (id, translation) VALUES (557, '自動, esddsp, artsdsp, 無し');
INSERT INTO public.potranslation (id, translation) VALUES (558, 'サウンドデーモンラッパーを選択してください:');
INSERT INTO public.potranslation (id, translation) VALUES (559, 'ときどき、mozilla はプラグイン(例えば flashplugin)のせいで /dev/dsp を開けずハングアップしてしまいます。dsp ラッパーを使うことでこの問題を回避できます。 ''auto'' は、使用しているサウンドデーモンを検出し、自動的に dsp ラッパーを選択します。 もしサウンドデーモンが動いていなければ、mozilla はどのラッパーも使いません。 この設定は /etc/mozilla/mozillarc に保存され、これはユーザの ~/.mozillarc によりオーバーライドできます。');
INSERT INTO public.potranslation (id, translation) VALUES (560, '言語/地域 自動選択機能を利用しますか?');
INSERT INTO public.potranslation (id, translation) VALUES (561, 'この設定により、Mozillaの言語/地域パックを自動的に選択することができます。これは、非英語圏の初心者に有用な設定です。');
INSERT INTO public.potranslation (id, translation) VALUES (562, 'この機能が正しく動作するために。LC_MESSAGE か LC_ALL 環境変数を設定しておいてください。');
INSERT INTO public.potranslation (id, translation) VALUES (563, 'Dispone de /etc/mozilla/prefs.js para personalizaciones.');
INSERT INTO public.potranslation (id, translation) VALUES (564, 'Mozilla en Debian carga el fichero /etc/mozilla/prefs.js después de ciertos scripts de configuración.');
INSERT INTO public.potranslation (id, translation) VALUES (565, 'Puede editar este fichero para realizar configuraciones generales, tales como la elección de fuentes.');
INSERT INTO public.potranslation (id, translation) VALUES (566, 'automático, esddsp, artsdsp, ninguno');
INSERT INTO public.potranslation (id, translation) VALUES (567, 'Por favor, elija el demonio de sonido para acceder al dsp.');
INSERT INTO public.potranslation (id, translation) VALUES (568, 'En ocasiones mozilla se cuelga cuando los plugins (por ejemplo el de Flash) bloquean /dev/dsp. Puede utilizar un demonio que haga de wrapper para acceder al dsp. «automático» decidirá cuál utilizar de acuerdo al demonio de sonido que se esté ejecutando. Si no se detecta ninguno, mozilla no usará ninguno. Este valor se guardará en /etc/mozilla/mozillarc y se puede sobreescribir con ~/.mozillarc.');
INSERT INTO public.potranslation (id, translation) VALUES (569, '/etc/mozilla/prefs.js is beschikbaar om instellingen te wijzigen.');
INSERT INTO public.potranslation (id, translation) VALUES (570, 'Debian mozilla zal /etc/mozilla/prefs.js inladen na enkele standaard voorkeurscripts te hebben ingeladen.');
INSERT INTO public.potranslation (id, translation) VALUES (571, 'U kunt dit bestand wijzigen voor systeemwijde instellingen (vb: fontinstellingen)');
INSERT INTO public.potranslation (id, translation) VALUES (572, 'automatisch, esddsp, artsdsp, geen');
INSERT INTO public.potranslation (id, translation) VALUES (573, 'Kies uw dsp-inwikkelaar van de geluidsachtergronddienst.');
INSERT INTO public.potranslation (id, translation) VALUES (574, 'Soms hangt mozilla omdat plugins (vb flashplugin) /dev/dsp vergrendelen. U kunt dsp-inwikkelaars gebruiken om dit op te lossen. ''automatisch'' zal beslissen welke dsp-inwikkelaars gebruikt moeten worden afhankelijk van de uitvoerende geluidsachtergronddienst. Wanneer er geen geluidsachtergronddienst wordt gedetecteerd, zal mozilla geen inwikkelaar gebruiken. Deze instelling zal worden bewaard in /etc/mozilla/mozillarc en kan overschreven worden door uw ~/.mozillarc.');
INSERT INTO public.potranslation (id, translation) VALUES (575, 'Automatische taal/regio-selectie inschakelen?');
INSERT INTO public.potranslation (id, translation) VALUES (576, 'Deze optie zorgt voor een automatische taal/regio-selectie in Mozilla gebruikmakend van de locale-instellingen. Het kan een systeembeheerder helpen die geconfronteerd wordt met honderden niet-Engels sprekende beginnelingen.');
INSERT INTO public.potranslation (id, translation) VALUES (577, 'Zet uw LC_MESSAGE- of LC_ALL-variabele om dit correct te laten werken.');
INSERT INTO public.potranslation (id, translation) VALUES (578, 'Pro přizpůsobení nastavení můžete použít /etc/mozilla/prefs.js.');
INSERT INTO public.potranslation (id, translation) VALUES (579, 'Mozilla v Debianu používá kromě dalších skriptů i soubor /etc/mozilla/prefs.js.');
INSERT INTO public.potranslation (id, translation) VALUES (580, 'V tomto souboru můžete nastavit vlastnosti pro všechny uživatele v systému (např. vhodná písma).');
INSERT INTO public.potranslation (id, translation) VALUES (581, 'auto, esddsp, artsdsp, žádný');
INSERT INTO public.potranslation (id, translation) VALUES (582, 'Vyberte program spravující zvukové zařízení dsp.');
INSERT INTO public.potranslation (id, translation) VALUES (583, 'Občas se může mozilla zaseknout, protože některé moduly (např. flash) zamknou /dev/dsp. Předejít tomu můžete použitím speciálního programu pro správu dsp. Volba ''auto'' se rozhodne podle toho, který správce dsp právě běží. Pokud žádný program nerozpozná, žádný se nepoužije. Toto nastavení se uloží do /etc/mozilla/mozillarc a můžete jej přepsat ve svém ~/.mozillarc.');
INSERT INTO public.potranslation (id, translation) VALUES (584, 'Povolit automatický výběr Jazyka/Země?');
INSERT INTO public.potranslation (id, translation) VALUES (585, 'Pokud odpovíte kladně, v Mozille se bude automaticky vybírat vhodný jazyk/země. To může velmi pomoci administrátorovi se spoustou neanglicky mluvících nováčků.');
INSERT INTO public.potranslation (id, translation) VALUES (586, 'Aby toto nastavení pracovalo správně, musíte mít správně nastavené proměnné LC_MESSAGE nebo LC_ALL.');
INSERT INTO public.potranslation (id, translation) VALUES (587, '/etc/mozilla/prefs.js kan bruges til at opsætte præferencer.');
INSERT INTO public.potranslation (id, translation) VALUES (588, 'Debians Mozilla vil læse /etc/mozilla/prefs.js efter standard præference-skriptsne er blevet læst.');
INSERT INTO public.potranslation (id, translation) VALUES (589, 'Du kan redigere i denne fil for system-globale indstillinger (f.eks. skrifttype indstillinger).');
INSERT INTO public.potranslation (id, translation) VALUES (590, 'auto, esddsp, artsdsp, ingen');
INSERT INTO public.potranslation (id, translation) VALUES (591, 'Vælg den lyd dæmon som skal bruges med mozilla.');
INSERT INTO public.potranslation (id, translation) VALUES (592, 'Nogle gange hænger mozilla fordi plugins (f.eks. flash) låser /dev/dsp.  Du kan bruge en lyd dæmon til at løse det. ''auto'' vil automatisk bestemme hvilken der skal bruges udfra en allerede kørende lyd dæmon Når ingen lyd dæmon er fundet, vil mozilla ikke bruge nogen. Denne indstilling vil blive gemt i /etc/mozilla/mozillarc og kan blive overskrevet af din ~/.mozillarc.');
INSERT INTO public.potranslation (id, translation) VALUES (593, 'Aktivér automatisk sprog/regionsvalg?');
INSERT INTO public.potranslation (id, translation) VALUES (594, 'Denne indstilling giver mulighed for automatisk sprog/regions valg i Mozilla ved hjælp af locale-indstillinger. Det kan være en stor hjælp for system administratorer der har hundredvis af ikke-engelsktalende nybegyndere.');
INSERT INTO public.potranslation (id, translation) VALUES (595, 'For at dette skal virke, skal LC_MESSAGE eller LC_ALL miljøvariablerne være sat korrekt.');
INSERT INTO public.potranslation (id, translation) VALUES (596, 'Tiedosto /etc/mozilla/prefs.js on asetuksien mukauttamista varten.');
INSERT INTO public.potranslation (id, translation) VALUES (597, 'Debianin mozilla lataa tiedoston /etc/mozilla/prefs.js oletusasetukset
INSERT INTO public.potranslation (id, translation) VALUES (598, 'Voit muokata tätä tiedostoa muuttaaksesi koko järjestelmää koskevia asetuksia.
(esim. kirjasinasetukset)');
INSERT INTO public.potranslation (id, translation) VALUES (599, 'auto, esddsp, artsdsp, ei mikään');
INSERT INTO public.potranslation (id, translation) VALUES (600, 'Valitse äänenhallinnan taustaprosessin dsp-kääre.');
INSERT INTO public.potranslation (id, translation) VALUES (601, 'Joskus mozilla voi jumiutua, jos liitännäiset (esim. flashplugin) lukitsevat
INSERT INTO public.potranslation (id, translation) VALUES (602, 'Salli automaattinen kielen/alueen valinta?');
