INSERT INTO public.potranslation (id, translation) VALUES (606, 'Mozillasta on poistettu tuki postscriptille. Tästä johtuen Xprint täytyy
INSERT INTO public.potranslation (id, translation) VALUES (607, 'Tämä ei ole ohjelmavirhe. Älä lähetä vikailmoitusta tästä. (Toivomuslista
INSERT INTO public.potranslation (id, translation) VALUES (608, '/etc/mozilla/prefs.js está dispoñible para actualiza-las preferencias.');
INSERT INTO public.potranslation (id, translation) VALUES (609, 'O mozilla de Debian ha cargar /etc/mozilla/prefs.js despois de cargar algúns scripts de preferencia por defecto.');
INSERT INTO public.potranslation (id, translation) VALUES (610, 'Pode editar este ficheiro para configuracións globais do sistema (é dicir, configuración dos tipos de letra)');
INSERT INTO public.potranslation (id, translation) VALUES (611, 'Failas /etc/mozilla/prefs.js skirtas parinkčių individualizavimui.');
INSERT INTO public.potranslation (id, translation) VALUES (612, 'Debiano mozilla įkels /etc/mozilla/prefs.js parinktis po to, kai bus įkeltos kai kurios pagal nutylėjimą numatytos parinktys.');
INSERT INTO public.potranslation (id, translation) VALUES (613, 'Jūs galite keisti šį failą, nustatymams sistemos mastu (pvz. šriftų nustatymams)');
INSERT INTO public.potranslation (id, translation) VALUES (614, 'auto, esddsp, artsdsp, joks');
INSERT INTO public.potranslation (id, translation) VALUES (615, 'Pasirinkite Jūsų garso įrenginio demono dsp aplanką (wrapper).');
INSERT INTO public.potranslation (id, translation) VALUES (616, 'Kartais mozilla stringa, kuomet jos priedas (pvz. flashplugin) blokuoja /dev/dsp. Šiai problemai spręsti galite naudoti dsp aplanką (wrapper). ''auto'' nuspręs, kurį dsp aplanką naudoti, priklausomai nuo veikiančio garso demono. Jei nebus aptiktas joks garso demonas, mozilla nenaudos jokio aplanko. Šie nustatymai bus išsaugoti faile etc/mozilla/mozillarc, bet Jūsų ~/.mozillarc gali būti viršesnis.');
INSERT INTO public.potranslation (id, translation) VALUES (617, 'Ar leisti automatinį kalbos/regiono parinkimą?');
INSERT INTO public.potranslation (id, translation) VALUES (618, 'Šis nustatymas leidžia automatiškai pasirinkti Mozill''os kalbos/regiono paketą, panaudojant locale nustatymus. Tai gali padėti sistemos administratoriui, susiduriančiam su šimtais ne anglų kalba kalbančių naujokų.');
INSERT INTO public.potranslation (id, translation) VALUES (619, 'Tam kad šis nustatymas veiktų, teisingai nustatykite savo LC_MESSAGE arba LC_ALL kintamuosius.');
INSERT INTO public.potranslation (id, translation) VALUES (620, 'Il file /etc/mozilla/prefs.js è disponibile per la personalizzazione delle preferenze.');
INSERT INTO public.potranslation (id, translation) VALUES (621, 'Debian Mozilla caricherà il file /etc/mozilla/prefs.js dopo aver caricato alcuni script di configurazione predefiniti.');
INSERT INTO public.potranslation (id, translation) VALUES (622, 'Si può editare questo file per impostazioni globali di sistema. (Ad esempio le impostazioni per i caratteri)');
INSERT INTO public.potranslation (id, translation) VALUES (623, 'auto, esddsp, artsdsp, nessuno');
INSERT INTO public.potranslation (id, translation) VALUES (624, 'Scegliere il modulo di incapsulazione dsp del demone di gestione del suono.');
INSERT INTO public.potranslation (id, translation) VALUES (625, 'Qualche volta Mozilla si blocca quando alcuni plugin (ad esempio il plugin Flash) mettono un lock alla periferica /dev/dsp. Si può incapsulare l''accesso alla periferica /dev/dsp per risolvere il problema. Scegliendo ''auto'' verrà selezionato un modulo di incapsulazione dsp in funzione del demone di gestione del suono in esecuzione. Quando nessun gestore di suoni viene trovato, Mozilla non userà alcun modulo di incapsulazione. Questa scelta sarà salvata nel file /etc/mozilla/mozillarc e potrà essere sovrascritta dal file ~/.mozillarc.');
INSERT INTO public.potranslation (id, translation) VALUES (626, 'Abilitare la selezione automatica Lingua/Regione?');
INSERT INTO public.potranslation (id, translation) VALUES (627, 'Questa impostazione consente una selezione automatica di lingua/regione utilizzando le preferenze locali. Puo` aiutare un sistemista che abbia a che fare con centinaia di nuovi utenti non a conoscenza della lingua inglese.');
INSERT INTO public.potranslation (id, translation) VALUES (628, 'Settare la variabile LC_MESSAGE o LC_ALL per consentire a questa impostazione di funzionare correttamente.');
INSERT INTO public.potranslation (id, translation) VALUES (629, 'Yapılandırma tercihlerini kişiselleştirmek için /etc/mozilla/prefs.js mevcuttur.');
INSERT INTO public.potranslation (id, translation) VALUES (630, 'Debian mozilla ön tanımlı tercih betiklerini yükledikten sonra /etc/mozilla/prefs.js dosyasını yükleyecektir.');
INSERT INTO public.potranslation (id, translation) VALUES (631, 'Sistem genelinde ayarlar için bu dosyayı düzenleyebilirsiniz. (ör. yazıtipi tanımları)');
INSERT INTO public.potranslation (id, translation) VALUES (632, 'otomatik, esddsp, artsdsp, yok');
INSERT INTO public.potranslation (id, translation) VALUES (633, 'Lütfen ses servisinin kullanacağı ses sistemini (dsp wrapper) seçin.');
INSERT INTO public.potranslation (id, translation) VALUES (634, 'Bazen mozilla, eklentilerin (ör. flashplugin) /dev/dsp''yi kilitlemesi yüzünden askıda kalır. Bu sorunu çözmek için ses sistemini (dsp wrapper) kullanabilirsiniz. ''otomatik'' seçeneği, çalışan ses servisine göre hangi ses sistemlerinin (dsp wrapper) kullanılması gerektiğine karar verecekir. Hiç bir ses servisi bulunamaz ise, mozilla herhangi bir sistem kullanmayacaktır. Bu ayar /etc/mozilla/mozillarc dosyasına kaydedilecektir. Fakat size ait ~/.mozillarc dosyasındaki ayarlar daha önceliklidir.');
INSERT INTO public.potranslation (id, translation) VALUES (635, '/etc/mozilla/prefs.js ist für die Anpassungen von Einstellungen verfügbar.');
INSERT INTO public.potranslation (id, translation) VALUES (636, 'Debians Mozilla wird die Datei /etc/mozilla/prefs.js nach dem Laden von einigen Standard-Einstellungsskripten laden.');
INSERT INTO public.potranslation (id, translation) VALUES (637, 'Sie können diese Datei bearbeiten, um systemweite Einstellungen vorzunehmen (z.B. Schriften-Einstellungen).');
INSERT INTO public.potranslation (id, translation) VALUES (638, 'automatisch, esddsp, artsdsp, kein');
INSERT INTO public.potranslation (id, translation) VALUES (639, 'Bitte wählen Sie die DSP-Hülle Ihres Sound-Daemons aus.');
INSERT INTO public.potranslation (id, translation) VALUES (640, 'Manchmal hängt Mozilla, da Erweiterungen (bspw. flashplugin) einen /dev/dsp sperren. Sie können das durch die Benutzung einer DSP-Hülle beheben. ''automatisch'' wird anhand des laufenden Sound-Daemons entscheiden, welche DSP-Hülle verwendet werden sollte. Falls kein Sound-Daemon erkannt wird, verwendet Mozilla keine Hülle. Diese Einstellung wird in /etc/mozilla/mozillarc abgespeichert und kann in Ihrer ~/.mozillarc überschrieben werden.');
INSERT INTO public.potranslation (id, translation) VALUES (641, 'Automatische Sprach-/Regionenauswahl aktivieren?');
INSERT INTO public.potranslation (id, translation) VALUES (642, 'Diese Einstellung ermöglicht eine automatische Auswahl der Sprach-/Regionenpakete in Mozilla mittels der »locale«-Einstellungen. Dies mag Systemadministratoren helfen, die sich Hunderten von nicht Englisch sprechenden Neulingen gegenüber sehen.');
INSERT INTO public.potranslation (id, translation) VALUES (643, 'Bitte setzen Sie Ihre »LC_MESSAGE«- oder »LC_ALL«-Variable entsprechend, so dass diese Einstellung korrekt funktioniert.');
